import '../styles/styles.css';

import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);

  const handleDropdownToggle = () => {
    setIsDropdownOpen(!isDropdownOpen);
  };

  return (
    <nav className="navbar">
      <div className="navbar__left">
        {/* Replace 'logo.png' with the path to your logo */}
        <img src="path/to/logo.png" alt="Logo" className="navbar__logo" />
        <h1 className="navbar__title">Website Name</h1>
      </div>

      {/* Navigation links for desktop */}
      <div className="navbar__links">
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/about">About</Link></li>
          <li>
            <div className="dropdown">
              <span className="dropdown__toggle" onClick={handleDropdownToggle}>
                Programs Offered <i className={`arrow ${isDropdownOpen ? 'up' : 'down'}`} />
              </span>
              {isDropdownOpen && (
                <div className="dropdown__menu">
                  <ul>
                    <li><Link to="/programs/mentorship">Mentorship</Link></li>
                    <li><Link to="/programs/interactions">Interactions</Link></li>
                    {/* Add more program links as needed */}
                  </ul>
                </div>
              )}
            </div>
          </li>
          <li><Link to="/login">Login</Link></li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;

